app = Flask(__name__)
CORS(app)

textract_client = boto3.client('textract', aws_access_key_id=str(os.environ.get('AWS_ACCESS_KEY_ID')), region_name="us-east-1",
                               aws_secret_access_key=str(os.environ.get('AWS_SECRET_ACCESS_KEY')))

aws_translate_client = boto3.client('translate', aws_access_key_id=str(os.environ.get('AWS_ACCESS_KEY_ID')),region_name="us-east-1",
                               aws_secret_access_key=str(os.environ.get('AWS_SECRET_ACCESS_KEY')))

client = ExpertAiClient()

@app.route("/analyse-photos", methods=["POST"])
def analyse_photo():
    data = request.json
    #print(data)
    #print(data["images"])
    extracted_text = ""
    for i,base64_string in enumerate(data["images"]):
        cleaned_string = base64_string[22:]
        file_name = str(i) + ".png"
        convert_base64_to_png(file_name,cleaned_string)
        extracted_text += get_text_from_file(textract_client,file_name)

    sentiment_array = analyse_sentiment(client,extracted_text)
    behavioral_traits = get_behavioral_traits_from_text(client, extracted_text)
    emotional_traits = get_emotional_traits_from_text(client, extracted_text)
    iptc_traits = get_iptc_traits_from_text(client,extracted_text)
    topics, lemmas = get_key_phrases_from_text(client, extracted_text)
    print(topics)
    base64_wordcloud = generate_word_cloud(extracted_text,lemmas,str(uuid.uuid1()))


    response = {
        'success': True,
        'data': {
            'sentiments': sentiment_array,
            'emotionalTraits': emotional_traits,
            'behaviourTraits': behavioral_traits,
            'iptcTraits': iptc_traits,
            'base64Wordcloud': base64_wordcloud
        }
    }
    return jsonify(response), 200

@app.route("/analyse-youtube-video", methods=["POST"])
def analyse_youtube_video():
    data = request.json
    video_id = data["videoId"]
    user_preferences = data["userPreferences"]
    text = get_transcript_from_youtube(video_id)
    print(len(text))
    if (len(text) > 10000):
        text = text[:10000]
    sentiment_array = analyse_sentiment(client,text)
    behavioral_traits = get_behavioral_traits_from_text(client, text)
    emotional_traits = get_emotional_traits_from_text(client, text)
    iptc_traits = get_iptc_traits_from_text(client,text)
    topics, lemmas = get_key_phrases_from_text(client, text)
    number, common_topics = get_common_topics(user_preferences,topics)
    base64_wordcloud = generate_word_cloud(text,lemmas,str(uuid.uuid1()))


    summary = get_summary_from_text(text)


    response = {
        'success': True,
        'data': {
            'summary':summary,
            'sentiments': sentiment_array,
            'emotionalTraits': emotional_traits,
            'behaviourTraits': behavioral_traits,
            'iptcTraits': iptc_traits,
            'base64Wordcloud': base64_wordcloud,
            'commonTopics': common_topics
        }
    }
    return jsonify(response), 200

