@app.route('/translate-response', methods=["POST"])
def translate_response():
    data = request.json
    translation_language = data["translationLanguage"]
    response_object = data["responseObject"]
    #print(response_object["data"]["summary"])
    data = translate_response_object(aws_translate_client,response_object["data"],translation_language)
    response = {
        'success': True,
        'data': data
    }
    return jsonify(response), 200

